        '<div class=\"words\"><p><div style=\"text-align: left;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i211.1dfe106eT6n5Lp\"><strong data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i8.1dfe106eW0Gc5h\">活动介绍</strong></div><div data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i206.1dfe106eT6n5Lp\" style=\"text-align: center;\">韦礼安「一直都在」音乐见面会-北京站</div><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_reviewer_check.0.i1.8bd1106etyyPIZ\">是你的爱指引我未来<br>深深拥抱我的现在<br>告诉我原来爱一直都在</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_reviewer_check.0.i1.8bd1106etyyPIZ\"><img src=\"//img.alicdn.com/imgextra/i3/2251059038/O1CN019oiOfh2GdSYbtwJyA_!!2251059038.jpg_q60.jpg_.webp\" width=\"750\" height=\"1050\" damai_width=\"750\" damai_height=\"1050\"><br></p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i32.5e41106eGtOdMa\">时间：2024年1月13日（周六）20:00</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i220.1dfe106eT6n5Lp\">地点：EAST &nbsp;LIVE（东郎展演中心）</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i220.1dfe106eT6n5Lp\">地址：北京市朝阳区建国门外郎家园10号61幢1层A3-062层(印艺文创园内)</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2oeg.project.detail-info.i0.124a7445eFkOZ7\">票务信息</p><p style=\"text-align: center;\">VIP¥488</p><p style=\"text-align: center;\"><u><strong data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i48.5e41106eOtr9fH\">（VIP权益：提前进场&amp;站前区&amp;巡演亲笔签名海报&amp;有机会获得与韦礼安合影机会）</strong></u></p><p style=\"text-align: center;\"><u><strong>备注：合影机会以现场抽签形式获得，限量6组，每组5人</strong></u></p><p style=\"text-align: center;\"><img src=\"//img.alicdn.com/imgextra/i4/2251059038/O1CN01dPeNja2GdSWgyxL8e_!!2251059038.jpg_q60.jpg_.webp\"><br></p><p style=\"text-align: center;\">普通票¥388</p><p style=\"text-align: center;\">早鸟票¥288</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2oeg.project.detail-info.i1.124a7445eFkOZ7\"><img src=\"//img.alicdn.com/imgextra/i2/2251059038/O1CN01HqkIcT2GdSWsaXgZi_!!2251059038.jpg_q60.jpg_.webp\"><br>韦礼安多首金曲：</p><p style=\"text-align: center;\">《一直都在》、《如果可以》、《女孩》、《慢慢等》、《有没有》、《狼》、《还是会》......</p><p style=\"text-align: center;\"><img src=\"//img.alicdn.com/imgextra/i1/2251059038/O1CN01JZWUQ32GdSWwCtU34_!!2251059038.jpg_q60.jpg_.webp\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i18.49e9106epjZh8C\"></p><p style=\"text-align: center;\"><span data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i19.49e9106epjZh8C\">出道以来韦礼安获奖无数，2011年凭借首张专辑获得金曲奖最佳新人奖的殊荣，</span><span>并在2015年以〈狼〉获得最佳作曲人奖。</span><span>创作才子韦礼安以阳光温暖的嗓音获得乐坛及歌迷的注目，长久累积丰沛的创作能</span><span>量，造就〈还是会〉、〈慢慢等〉等脍炙人口金曲， 「韦氏情歌」 更是知名偶</span><span>像剧必搭主题曲</span></p><p style=\"text-align: center;\"><span><img src=\"//img.alicdn.com/imgextra/i2/2251059038/O1CN014ooCq02GdSWt9wJYi_!!2251059038.jpg_q60.jpg_.webp\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i208.1dfe106eT6n5Lp\"></span></p><p style=\"text-align: center;\">韦礼安「一直都在」音乐会，正在解锁更多城市中，这个冬天我们一起过，期待你的到来</p><p style=\"text-align: center;\" data-spm-anchor-id=\"a2o7u.ssp_merchant_form.0.i227.1dfe106ej4u8eV\">城市解锁中......</p><p><br></p></p></div>',
